  gardent01: {
    background:
      "linear-gradient(29deg, rgba(2,0,36,1) 24%, rgba(69,4,88,1) 71%, rgba(62,57,184,1) 100%)",
  },
  flexCenter: {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
